column64:
 ; ; ; ; ; ;TV controls were difficult to use.
Carpet in the first room we were given had wrinkled carpeting that needed stretching
Entry door did not automatically latch on closing; ; ; ; ; ; ; ; ; ; ; ; ; ; ; ; ;

 ; ; ;Missing blow dryer - and yes, we checked the closet. 
Open breaker box. 
The lighted pedestal mirror didn't work.; ; ;Really nice hotel with great staff (with the exception of the breakfast host) and a really ridiculous breakfast mask policy. Why not mask on until seated - as recommended?; ; ; ; ; ; ; ; ; ; ; ; ; ; ; ; ;

 ; ; ;Electrical outlet in bedroom, closet, one outlet loose and wouldn’t hold plug.

Bathroom mat/rubber, frayed and very old.
The entire room had a strong odor-not mold or cleaning product, but distinct and unfamiliar. Definitely negative.; ; ;Covid has caused each of us to adjust to the new norm and that’s ok.  The hot breakfast & coffee (eggs, meat, potatoes, toast and coffee) was not the best.  No butter or jam provided w/other condiments, coffee was weak, despite Starbucks being onsite and in the room.  Refills weren’t offered, so we bought a cup from Starbucks, which was lukewarm.  The hotel’s C-19 attempts are well noted, F/B and room quality need an overhaul.; ; ; ; ; ; ; ; ; ; ; ; ; ; ; ; ;

